import React from 'react';
import Breadcrumb from '../components/Breadcrumb';

function Iletisim() {
  return (
    <div>
      <Breadcrumb />
      <h1>İletişim</h1>
      <p>Tescom iletişim bilgileri burada yer alacaktır.</p>
    </div>
  );
}
export default Iletisim;
